import React, { useState } from "react";
import PlayerList from "../../components/PlayerList/PlayerList";
import SearchPlayers from "../../components/SearchPlayer/SearchPlayers";
import "./MyTeamPage.css";

const MyTeamPage = () => {
  const [players] = useState([
    {
      id: 1,
      firstName: "E.",
      lastName: "Haaland",
      team: "Manchester City",
      position: "Attacker",
      headshotUrl: "https://example.com/haaland.png",
      stats: "32.5 mln",
    },
    {
      id: 2,
      firstName: "Vinicius",
      lastName: "Jr",
      team: "Real Madrid",
      position: "Attacker",
      headshotUrl: "https://example.com/vinicius.png",
      stats: "29.2 mln",
    },
    // Add more sample players as needed
  ]);

  return (
    <div className="main-content">
      <div className="left-panel">
        <PlayerList title="Attackers" players={players.slice(0, 3)} />
        <PlayerList title="Midfielders" players={players.slice(3, 6)} />
        <PlayerList title="Defenders" players={players.slice(6, 9)} />
      </div>
      <div className="right-panel">
        <SearchPlayers />
      </div>
    </div>
  );
};

export default MyTeamPage;
